import React from "react"
import '../../assets/css/Busquedas.css';

import Container from 'react-bootstrap/Container'

import { StickyContainer, Sticky } from 'react-sticky';



const containerBg = i => `hsl(${i * 40}, 70%, 90%)`;
const headerBg = i => `hsl(${i * 40}, 70%, 50%)`;

class SearchResult extends React.Component{

  render(){
    return(
      <Container style={{ width: '50vh', height: '40vh' }}>
              {[1, 2, 3, 4, 5, 6, 7, 8].map(i => (
                <StickyContainer
                  key={i}
                  className="container"
                  style={{ background: containerBg(i) }}
                >
                  <Sticky>
                    {({ style }) => (
                      <h1 style={{ ...style, background: headerBg(i), height: '100vh' }} />
                    )}
                  </Sticky>

                  <h2 className="text-center">{`<StickyContainer #${i} />`}</h2>
                </StickyContainer>
              ))}
            </Container>
    )
  }
}
export default SearchResult
